// /** @jsxRuntime classic */
// /** @jsx jsx */
import { VFC } from 'react';
import { jsx, css } from '@emotion/react';
import { Container, Grid } from 'semantic-ui-react';

const container = css`
  margin: 70px 0 !important;
  width: 100%;
  @media (max-width: 770px) {
    display: block;
    margin: 50px 0 !important;
  }
`;
const header = css`
  margin-bottom: 30px;
  @media (max-width: 770px) {
    margin-bottom: 10px;
  }
`;
const images = css`
  margin: 40px 0 !important;
`;
const fuelContainer = css`
  display: flex;
  flex-direction: row;
  align-items: center;
  justify-content: center;
  margin-bottom: 20px;
`;
const fuelLogo = css`
  background-size: contain;
  background-position: 0 center;
  background-repeat: no-repeat;
  font-size: 45px;
  font-weight: 600;
  font-stretch: normal;
  font-style: italic;
  line-height: 1.4;
  color: #04c399;
  padding-left: 20px;
  margin-right: 45px;
`;
const binance = css`
  width: 70%;
  height: 80px;
`;
const image = css`
  max-width: 50%;
  height: 80px;
`;

const Clients: VFC = () => (
  <Container css={container}>
    <Container text textAlign="center" css={header}>
      <h2>Clients and Research Supporters</h2>

      <Grid columns={2} stackable css={images} textAlign="center">
        <Grid.Row>
          <Grid.Column>
            <div css={fuelContainer}>
              <img
                src="data:image/svg+xml;base64,"
                alt="fuel"
              />
              <span css={fuelLogo}>Fuel</span>
            </div>
          </Grid.Column>
          <Grid.Column>
            <img
              src="https://hashcloak.com/logos/celo.png"
              alt="celo"
              css={image}
            />
          </Grid.Column>
        </Grid.Row>
        <Grid.Row>
          <Grid.Column>
            <img
              src="https://upload.wikimedia.org/wikipedia/commons/1/12/Binance_logo.svg"
              alt="binance"
              css={binance}
            />
          </Grid.Column>
          <Grid.Column>
            <img
              src="https://esp.ethereum.foundation/static/horz-logo-065bcbe38b2208c0239b3bc7c661258e.svg"
              alt="ecosystem-support-program"
              css={image}
            />
          </Grid.Column>
        </Grid.Row>
      </Grid>
    </Container>
  </Container>
);

export default Clients;
